import { Injectable } from '@angular/core';
import { InfectionPulmonaire } from '../models/InfectionPulmonaire';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class PulmonaireService {

  private apiUrl = 'https://localhost:7129/api/InfectionPulmonaires';

  constructor(private http: HttpClient) { }
  addpul(InfectionPulmonaire: InfectionPulmonaire): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', InfectionPulmonaire);

    return this.http.post<any>(`${this.apiUrl}/addpul`, InfectionPulmonaire, { observe: 'response' });
  }}
